            );INSERT INTO "community_carriers" VALUES(237138204635955200,895301687978385438);INSERT INTO "community_carriers" VALUES(413575373897596930,958393004199129188);CREATE TABLE nominees( 
                nominatorid INT NOT NULL,
                pillarid INT NOT NULL,
                note TEXT
            );INSERT INTO "nominees" VALUES(98623236966744064,608547442866257922,'Hauling a lot consistently and for many different carriers. And always posting demand updates ðŸ˜Ž ');INSERT INTO "nominees" VALUES(371736768732463115,762741683111854080,'the 101 on booze cruise. Was very detailed and friendly.');INSERT INTO "nominees" VALUES(291231436789383169,616436412765437952,'Very helpful, on the ball');INSERT INTO "nominees" VALUES(371736768732463115,232610258151931906,'always sends very nice photos of his exploration adventures in <#811707644309405706> , and makes me feel included in those.');INSERT INTO "nominees" VALUES(133962599015383041,237138204635955200,'Used his own carrier to help me catch up with another carrier going on my first Booze Cruise. Was extremely helpful with explaining how to do things and getting me on my way. Even though a pesky blight prevented my first the Booze Cruise, he helped me become I was a part of an amazing effort saving RP from a famine! Made my first interaction with this group amazing.');INSERT INTO "nominees" VALUES(174192688172630027,272934980181557248,'he was active as hell and helped us coming to the peak with a good slot management');INSERT INTO "nominees" VALUES(237138204635955200,375670616931565569,'giving great detailed and helpful responses in multiple channels the last days. at least that is since when i noticed them a lot.');INSERT INTO "nominees" VALUES(237138204635955200,200235739491991552,'is in my eyes the most present ACO and every interaction has been more than great. Positive, well informed and has the <:Oprah:813816500653785089>  attitude');INSERT INTO "nominees" VALUES(224976709525438464,887089070570893353,'For stepping up and coordinating the BC for hours, selflessly trying to get everyone else in before himself');INSERT INTO "nominees" VALUES(211891698551226368,407977573105139713,'Seems like a good egg');INSERT INTO "nominees" VALUES(211891698551226368,517591024126656532,'helpful, some nice videos');INSERT INTO "nominees" VALUES(455647994042384415,887089070570893353,'Ran a smooth Shard Carrier service, seems to have the needs of others in mind');INSERT INTO "nominees" VALUES(738825540139614208,200235739491991552,'always helping others');INSERT INTO "nominees" VALUES(795689195246583838,185896342445359105,'Keen to help out and get involved. Wants to help others.');INSERT INTO "nominees" VALUES(609484263624016079,200235739491991552,'Extremely helpful during the BC, in chat and around the server overall');INSERT INTO "nominees" VALUES(335087150523482122,200235739491991552,'Always helping out people, fun to be around. obviously active with the community as a Somm and CCO. seems like a great fit for CPillar');DELETE FROM "sqlite_sequence";INSERT INTO "sqlite_sequence" VALUES('carriers',152);COMMIT;